import React from 'react'
import { NavLink } from 'react-router-dom';
import homeIcon from '../homeIcon.png'

export const HomeButton = () => {
    return (
        <div className="app">

            <NavLink to="/" >
                <img src={homeIcon} alt="homeIcon" />
            </NavLink>
        </div>
    )
}

export default HomeButton;
